It is not easy with a headstrong, wild cowgirl like Chary Kiss. She easily breaks any studs who tries his luck with the beautiful farm babe, so it often requires two men to tame the reckless beauty. Today Ian and Kristian visited her farmhouse to satisfy the girl's notorious sexual appetite... but still, it was a challenge for both of them.
